import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {

    const navStyle = {
        color: '#fff',
        fontWeight: '600',
        fontSize: '2vw'
    }

  return (
    <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
            <Link to='/'>
                <li>Home</li>
            </Link>
            <Link style={navStyle} to='/about'>
                <li>About</li>
            </Link>
            <Link style={navStyle} to='/services'>
                <li>Services</li>
            </Link>
            <Link style={navStyle} to='/projects'>
                <li>Our Projects</li>
            </Link>
            <Link style={navStyle} to='/contact'>
                <li>Contact</li>
            </Link>
        </ul>

    </nav>
  );
}

export default Nav;
